,p_process_name=>'Create Collection'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'  lv_query VARCHAR2(4000) := '''';',
'BEGIN',
'  IF apex_collection.collection_exists (p_collection_name=>''AD_USERS_REPORT'') THEN',
'    apex_collection.delete_collection (p_collection_name=>''AD_USERS_REPORT'');',
'  END IF;',
'  SELECT ''SELECT AUX.USER_ID, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, ''',
'    || listagg(info, '', '') within GROUP (',
'  ORDER BY sequence)',
'    ||'' FROM (SELECT aud.user_id, aud.user_info_id, aud.detail_value''',
'    ||'' FROM ad_user_details aud, ad_users au WHERE aud.user_id = au.user_id''',
'    ||'' AND au.organization_id = ''',
'    ||:P200_ORGANIZATION_ID',
'    ||'') pivot (MAX(detail_value) FOR user_info_id IN (''',
'    || listagg(user_info, '','') within GROUP (',
'  ORDER BY sequence)',
'    ||'')) AUX ORDER BY user_id''',
'  INTO lv_query',
'  FROM (SELECT user_info_id',
'    ||'' as ''',
'    ||info user_info, ''AUX.''||info info, sequence',
'  FROM ad_user_info',
'  WHERE organization_id = :P200_ORGANIZATION_ID',
'  AND enabled           = ''Y''',
'  AND sysdate BETWEEN NVL(date_from, sysdate) AND NVL(date_to, sysdate)',
'  );',
'  apex_collection.create_collection_from_queryb2( p_collection_name => ''AD_USERS_REPORT'', p_query => lv_query );',
'END;'))
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when=>wwv_flow_string.join(wwv_flow_t_varchar2(
'  SELECT 1 ',
'  FROM ad_user_info',
'  WHERE organization_id = :P200_ORGANIZATION_ID',
'  AND enabled           = ''Y''',
'  AND sysdate BETWEEN NVL(date_from, sysdate) AND NVL(date_to, sysdate)'))
,p_process_when_type=>'EXISTS'
);
